import React, { useState, useEffect, useRef } from 'react';
import ProgressBar from 'progressbar.js';
import './App.css';

function App() {
  const [isLoading, setIsLoading] = useState(true);
  const splashTextRef = useRef(null);
  const [images, setImages] = useState({});

  useEffect(() => {
    // 画像を読み込む
    const req = require.context('./assets/images', false, /\.(png|jpe?g|svg)$/);
    const imageList = req.keys().reduce((acc, key) => {
      const imageName = key.replace('./', '').replace(/\.(png|jpe?g|svg)$/, '');
      acc[imageName] = req(key);
      return acc;
    }, {});
    setImages(imageList);

    // プログレスバーの設定
    const bar = new ProgressBar.Line(splashTextRef.current, {
      easing: 'easeInOut',
      duration: 1000,
      strokeWidth: 0.2,
      color: '#555',
      trailWidth: 0.2,
      trailColor: '#bbb',
      text: {
        style: {
          position: 'absolute',
          left: '50%',
          top: '50%',
          padding: '0',
          margin: '-30px 0 0 0',
          transform: 'translate(-50%,-50%)',
          fontSize: '1rem',
          color: '#fff',
        },
        autoStyleContainer: false,
      },
      step: (state, bar) => {
        bar.setText(Math.round(bar.value() * 100) + ' %');
      },
    });

    bar.animate(1.0);

    // ローディング終了
    setTimeout(() => {
      setIsLoading(false);
    }, 1000);
  }, []); // useEffectの閉じ括弧の位置を修正

  return (
    <div className="bg-gray-200 font-sans">
      {isLoading && (
        <div id="loader" className="fixed top-0 left-0 w-full h-full bg-gray-100 flex justify-center items-center flex-col z-50">
          <img src={images.loading} alt="ローディング中" className="w-24" />
          <div ref={splashTextRef} className="mt-4 text-xl text-gray-600">Now loading...</div>
        </div>
      )}

      {!isLoading && (
        <div className="container mx-auto px-4 sm:px-6 lg:px-8">
          <div className="header text-center py-8">
            <img className="w-36 h-36 rounded-full mx-auto" src={images.icon} alt="プロフィール写真" />
            <h1 className="text-4xl mt-2">わさび</h1>

            <ul className="flex justify-center space-x-4 mt-4">
              <li>
                <a
                  className="inline-flex items-center px-6 py-3 bg-white rounded-full cursor-pointer transition-colors duration-300 hover:bg-black-500 hover:text-white exampleClass"
                  href="https://twitter.com/melt_wasabi"
                >
                  <img className="h-6 w-6 mr-2" src={images.X} alt="X(Twitter)" />
                  <span>@melt_wasabi</span>
                </a>
              </li>
              <li>
                <a
                  className="inline-flex items-center px-6 py-3 bg-white rounded-full cursor-pointer transition-colors duration-300 hover:bg-black-500 hover:text-white exampleClass"
                  href="https://www.instagram.com/melt_wasabi"
                >
                  <img className="h-6 w-6 mr-2" src={images.Instagram} alt="Instagram" />
                  <span>@melt_wasabi</span>
                </a>
              </li>
            </ul>

            <div className="mt-4 bg-white p-6 rounded shadow">
              <p className="text-lg leading-relaxed text-left">
                こんにちはー！！元ガジェ界のわさびです！<br />
                このページは自己紹介ページです！！
              </p>
              <br />
              <p className="text-lg leading-relaxed text-left">
                【趣味】
                <br />
                <ul className="list-disc list-inside">
                  <li>電車で大回り乗車をすること</li>
                  <li>寝ること</li>
                </ul>
              </p>
            </div>

            <div className="mt-4 bg-white p-6 rounded shadow">
              <p className="text-lg leading-relaxed text-left">【所有デバイス】</p>
              <ul className="list-disc list-inside">
                <li>Galaxy S23 Ultra (au運用)</li>
                <li>iPhone 15 Pro (Rakuten運用)</li>
              </ul>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
